import { Component } from "react";


class Car extends Component{

  constructor(props){
    super(props)
    this.state = {
      brand:"Ford",
      model:"Mustang",
      type:"Car",
      color:"Red"
    }
  }

  changeColor(){
    this.state.color = "Blue"
  }

  render(){
    return (
      <div>
        <h1>
          brand is {this.state.brand}
        </h1>
        <p>
          color = {this.state.color}
        </p>
        <button type="button" onClick={this.changeColor}>change color</button>
      </div>
    )
  }


}


export default Car;
